import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FF6900',
  },
  headerText: {
    fontSize: 28,
    fontWeight: 'bold',
    color: 'white',
    fontFamily: 'Helvetica',
  },
  dayText: {
    fontSize: 20,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 8,
    textAlign: 'center',
  },
  eventContainer: {
    marginBottom: 8,
    borderRadius: 10,
    overflow: 'hidden',
    backgroundColor: 'white',
  },
  currentEventContainer: {
    backgroundColor: '#4CAF50',
  },
  currentEventText: {
    fontSize: 16,
    fontWeight: 'bold',
    color: 'white',
    padding: 8,
    backgroundColor: '#4CAF50',
  },
  eventContent: {
    padding: 12,
  },
  eventTime: {
    fontSize: 16,
    fontWeight: 'bold',
  },
  eventName: {
    fontWeight: 'bold',
    marginTop: 4,
  },
  locationLink: {
    color: 'blue',
    textDecorationLine: 'underline',
    marginTop: 4,
  },
  footerText: {
    color: 'white',
  },
});

export default styles;
